import "./HeroStyle.css"


function Hero (props) {

    return(
        <>
        <div className={props.cName}>
            <img src={props.HeroImage} alt="HeroImg" />
            <div className="Hero-text">
                <h1>{props.title}</h1>
                <p> {props.text}
                </p>
                <a href={props.url} className={props.btnClass}>
                 {props.button}
                </a>
            </div>
        </div>
        </>
    )
}
export default Hero
